import React from 'react';
import {Router} from 'react-router'
import {Route} from 'react-router-dom'
import Page from './pages/User/Page';
function App() {
  return (
    <Router>
      <Route path = "/" component = {Page}/>
    </Router>
  );
}

export default App;
